import React, {useState} from 'react';
import {headerData} from '../../data';

const Nav = () => {
    const [headers, setHeaders] = useState(headerData);
    console.log("data is" + headers);
    return (
        <nav className="container">
            <ul>
                {
                    headers.map((header) => {
                        console.log(header.value);
                        <li>{header.value}</li>
                    })
                }
            </ul>
        </nav>
    )
}

export default Nav
